  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0148766 includes Surface
  underway data collected from LAURENCE M. GOULD in the South Atlantic Ocean, South
  Pacific Ocean and Southern Oceans (> 60 degrees South) from 2002-03-23 to 2002-12-23.
  These data include BAROMETRIC PRESSURE, Partial pressure (or fugacity) of carbon
  dioxide - atmosphere, Partial pressure (or fugacity) of carbon dioxide - water,
  SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect these data
  include Carbon dioxide (CO2) gas analyzer and Shower head chamber equilibrator for
  autonomous carbon dioxide (CO2) measurement.nnThese data were collected by Taro
  Takahashi of Columbia University; Lamont-Doherty Earth Observatory, Colm Sweeney
  of US DOC; NOAA; OAR; Earth System Research Laboratory; Climate Monitoring and Diagnostics
  Laboratory, David R. Munro of University of Colorado - Boulder and Tim Newberger
  of University of Colorado at Boulder; Cooperative Institute for Research In Environmental
  Sciences as part of the VOS_LMG_NOAA_2002 data set. CDIAC associated the following
  cruise ID(s) with this data set: 33LG20020323nnThe Global Volunteer Observing Ship
  (VOS) Program is coordinated by the UNESCO International Ocean Carbon Coordination
  Project (IOCCP). International groups from 14 countries have been outfitting research
  ships and commercial vessels with automated CO2 sampling equipment to analyze the
  carbon exchange between the ocean and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
